import React from "react";

const Home = () => {
  return (
      <Box id="home" bg="red.500">
          <Box w="70%" h="100%" display="" >
          <Box >
            <Heading>Hey ! I'm Shivam</Heading>
            <Text>Full stack web Developer</Text>
          </Box>
          <Box w="70%">
            <Image
              borderRadius="full"
              boxSize="150px"
              src="https://bit.ly/dan-abramov"
              alt="Dan Abramov"
            />
          </Box>
          </Box>
  
      
      </Box>
    
  );
};

export default Home;
